import React from "react";
import "./assets/css/main.css";


const Footer = () => {
  return (
    <div>
						<br></br>
						<ul className="icons">
							<li><a href="#" className="icon fa-twitter" style={{ fontSize: "2.1em" }}><span className="label">Twitter</span></a></li>
							<li><a href="#" className="icon fa-facebook-square" style={{ fontSize: "1.9em" }}><span className="label">Facebook</span></a></li>
							<li><a href="#" className="icon fa-send" style={{ fontSize: "1.85em" }}><span className="label">Telegram</span></a></li>
							<li><a href="#" className="icon fa-github" style={{ fontSize: "2.1em" }}><span className="label">GitHub</span></a></li>
							<li><a href="#" className="icon fa-google-plus" style={{ fontSize: "1.9em" }}><span className="label">Google+</span></a></li>
						</ul>

						<div className="copyright">
							<ul className="menu">
								<li>&copy; JavaScript. All rights reserved</li><li>Design: <a href="http://">Tockyj Bohdan</a></li>
							</ul>
						</div>
				</div>
  );
};

export default Footer;
